import * as React from 'react';
import View from './view';
import { InputEvent } from './types';
import Dropdown from './dropdown';
import Input from './input';

export default class LienHolderInput extends React.Component<any, any> {
    constructor(props: any) {
        super(props);

        this.state = {
            lienHolderInput: {}
        };
    }

    componentDidUpdate(prevProps: any, prevState: any, snapshot: any) {
        if (this.props.value !== prevProps.value) {
            this.setState({
                lienHolderInput: this.props.value || {}
            });
        }
    }
    render() {
        var props = {
            ...this.props
        };
        delete props.children;
        const { companies }: { companies: LienHolder[] } = dataSource;
        let lienHolder: LienHolder = this.state.lienHolderInput;
        return (
            <View >
                <Dropdown options={companies.map(v => v.company)} value={lienHolder && lienHolder.company ? lienHolder.company.value : null} onChange={(val: InputEvent) => {
                    if (val.target.value) {
                        let category = companies.find(v => v.company.value === val.target.value);
                        if (category && category.company.value !== lienHolder.company.value) {
                            this.setState({
                                lienHolderInput: {
                                    ...lienHolder,
                                    ...category
                                }
                            }, () => {
                                if (this.props.onChangeText) {
                                    this.props.onChangeText(this.state.lienHolderInput);
                                }
                            });
                        }
                    }
                }} />
                {
                    lienHolder && lienHolder.companyDetail ? (
                        <View>
                            <Input value={lienHolder.companyDetail.addressLine1} disabled={true} />
                            <Input value={lienHolder.companyDetail.addressLine2} disabled={true} />
                            <Input value={lienHolder.companyDetail.city} disabled={true} />
                            <Input value={lienHolder.companyDetail.state} disabled={true} />
                            <Input value={lienHolder.companyDetail.zipcode} disabled={true} />
                        </View>) : null}
            </View>
        );
    }
}

export interface LienHolderCompany {
    value: string;
    title: string;
}
export interface LienHolderCompanyDetail {
    name: string;
    addressLine1: string;
    addressLine2: string;
    city: string;
    state: string;
    zipcode: String;
}
export interface LienHolder {
    company: LienHolderCompany;
    companyDetail?: LienHolderCompanyDetail;
}

